import React, { Component } from "react";
import { Grid } from "@material-ui/core";
import RightPane from "./RightPane";

class Body extends Component {
  render() {
    return (
      <Grid container={true} justify="center">
        <Grid item xs={12} sm={6}>
          <RightPane />
        </Grid>
      </Grid>
    );
  }
}
export default props => (
  <Grid container={true} justify="center">
    <Grid item xs={12} sm={6}>
      <RightPane />
    </Grid>
  </Grid>
);
